import styled from "styled-components";

export const Section = styled.section`
border:1px solid red;
`;
export const Title = styled.div`
border:1px solid red;
background-color:white;
text-align  :center;
& h2{
  color: #000;
  text-transform:uppercase;
  font-size:36px;
}
`;
